import Header from '../components/Header.jsx'
import './forms-style.css'
import nyanDuck from '../assets/Nyan_kaczka.png'
import Statki from '../components/IslandStatki.jsx'

class Profile extends React.Component {
    constructor() {
        super();
        this.state = {
            name: '',
            password:''
        };

        this.handleChange = this.handleChange.bind(this);
        this.handlePassword = this.handlePassword.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);

    }
    handleChange(event) {
        this.setState({name: event.target.value});

    }
    handlePassword(event) {
        this.setState({password: event.target.value});

    }

    handleSubmit(event) {

       console.log('tutaj wolanie na backend')

    }

    render() {

        return (
            <div className="app">
                <Header />
                <h2 className="form-title">Tw√≥j profil</h2>

                <div className="form-container">

                <div className="buttons-container">
                {this.state.path==="/" || this.state.path==="/register"? <a href="/login" className="header-button"> Zaloguj </a>:null}
                {this.state.path==="/" || this.state.path==="/login"? <a href="/register" className="header-button"> Zarejestruj </a>:null}
                {this.state.path==="/" || this.state.path==="/profile"? <a href="/profile" className="header-button"> Profil </a>:null}
                </div>

                </div>
                <img src={nyanDuck} alt="nyan kaczka rotated" className="nyanRotated" />

            </div>
        )
    }
}


export default Profile;
